import { UploadOutlined, FileAddOutlined } from "@ant-design/icons";

const sidebarItems = [
  {
    key: "upload-single",
    label: "upload-single",
    icon: <UploadOutlined />,
  },
  {
    key: "bulk-upload",
    label: "bulk-upload",
    icon: <FileAddOutlined />,
  },
];

export default sidebarItems;
